function calculateLuminance(a){a=a.replace("#","").trim(),/^([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.test(a)||/^([a-f\d]{1})([a-f\d]{1})([a-f\d]{1})$/i.test(a)&&(a=a.replace(/^([a-f\d]{1})([a-f\d]{1})([a-f\d]{1})/i,"$1$1$2$2$3$3"));for(var t=/^([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(a),e=[],c=[],f=1;f<=3;f++)e[f]=parseInt(t[f],16)/255,c[f]=e[f]<=.03928?e[f]/12.92:Math.pow((e[f]+.055)/1.055,2.4);return.2126*c[1]+.7152*c[2]+.0722*c[3]}function calculateContrast(a,t){var e=calculateLuminance(a),c=calculateLuminance(t);return+((Math.max(e,c)+.05)/(Math.min(e,c)+.05)).toFixed(2)}